  .rightbuttons{

  body {
    margin: 10;
    font-family: 'Lato', sans-serif;
    background-color: royalblue;
  }
  .canvas-container{
    margin: 0 auto;
  }
  .overlay {
      text-align: center;
      height: 0%;
      width: 50%;
      position: fixed;
      z-index: 1;
      top: 25%;
      left: 25%;
      background-color: rgb(0,0,0);
      background-color: #ffffff;
      overflow-y: hidden;
      transition: 0.5s;
  }
  .overlay-selection {
      text-align: center;
      position: relative;
      height: 0%;
      width: 100%;
      position: fixed;
      z-index: 1;
      top: 0;
      left: 0;
      background-color: rgb(0,0,0);
      background-color: #ffffff;
      overflow-y: hidden;
      transition: 0.5s;
  }
  .overlay-content {
      position: relative;
      top: 10%;
      width: 100%;
      text-align: center;
      margin-top: 30px;
  }
  .closebtn {
      position: absolute;
      top: 20px;
      right: 45px;
      font-size: 60px !important;
  }
  @media screen and (max-height: 450px) {
    .overlay {overflow-y: auto;}
    .closebtn {
      font-size: 40px !important;
      top: 15px;
      right: 35px;
    }
}
</style>
